import { Link } from "react-router-dom";

const EVENTS = [
  { id: 'e1', title: 'Dummy event 1', date: '04-10-2025', description: 'This is a great event!'},
  { id: 'e2', title: 'Dummy event 2', date: '04-11-2025', description: 'This is another great event!'},
  { id: 'e3', title: 'Dummy event 3', date: '04-12-2025', description: 'This will be the best event!'},
];

export default function EventsPage() {
  return (
    <>
      <h1>The Events Page</h1>
      <ul>
        {EVENTS.map((event) => (
          <li key={event.id}>
            <h2>{event.title}</h2>
            <p>{event.date}</p>

          </li>
        ))}
      </ul>
    </>
  );
}
